import {Text, View, StyleSheet} from 'react-native';

const GameDetailScreen = () => {
    return <View style={{alignItems: "center"}}>
        <Text>Game Details Screen</Text>
    </View>
}

const styles = StyleSheet.create({});

export default GameDetailScreen;
